package com.letv.mms.bean;


public class DictionaryInfo extends BaseBean {
	
		private Integer valueId;//   	private String value;//   	private Integer typeId;//   	private Integer parentValueId;//   	private Integer level;//   	private Integer ifDelete;//   	public Integer getValueId() {	    return this.valueId;	}	public void setValueId(Integer valueId) {	    this.valueId=valueId;	}	public String getValue() {	    return this.value;	}	public void setValue(String value) {	    this.value=value;	}	public Integer getTypeId() {	    return this.typeId;	}	public void setTypeId(Integer typeId) {	    this.typeId=typeId;	}	public Integer getParentValueId() {	    return this.parentValueId;	}	public void setParentValueId(Integer parentValueId) {	    this.parentValueId=parentValueId;	}	public Integer getLevel() {	    return this.level;	}	public void setLevel(Integer level) {	    this.level=level;	}	public Integer getIfDelete() {	    return this.ifDelete;	}	public void setIfDelete(Integer ifDelete) {	    this.ifDelete=ifDelete;	}
}
